import { useState } from 'react'
const Tasks = () => {

    const [tasks, setTasks] = useState(
        {
            id: 1,
            text: 'Doctors Appointment',
            day: 'Feb 5th at 2:30',
            reminder: true,
        },
        {
            id: 2,
            text: 'dentist Appointment',
            day: 'Feb 21th at 2:30',
            reminder: true,
        },
    )

    return (
        <>
            {tasks.map((task) => (
                <h3 key={task.id}>{task.text}</h3>
            ))}
        </>
    )
}

export default Tasks
